// Clean and validate domain, create dedupe hash for ALL items
const crypto = require('crypto');
const today = new Date().toISOString().split('T')[0];

// Process all items from input
const results = [];

for (const inputItem of $input.all()) {
  const item = inputItem.json;

  // Check if domain exists and is valid
  if (!item.domain || typeof item.domain !== 'string') {
    results.push({ json: { ...item, skip: true, reason: 'Invalid or missing domain' } });
    continue;
  }

  // Clean domain - remove protocol, www, trailing slashes
  let cleanDomain = item.domain.toLowerCase()
    .replace(/^https?:\/\//i, '')
    .replace(/^www\./i, '')
    .replace(/\/$/, '')
    .trim();

  // Validate domain format
  if (!cleanDomain.includes('.') || cleanDomain.length < 4) {
    results.push({ json: { ...item, skip: true, reason: 'Invalid domain format' } });
    continue;
  }

  // Create dedupe hash (domain + date)
  const dedupeString = `${cleanDomain}-${today}`;
  const dedupeHash = crypto.createHash('md5').update(dedupeString).digest('hex');

  // Add processed item to results
  results.push({
    json: {
      ...item,
      domain: cleanDomain,
      dedupe_hash: dedupeHash,
      skip: false
    }
  });
}

return results;

// ICP Filter for Apollo Enriched Data
const items = $input.all();
const results = [];

// ICP Rules - Ideal Customer Profile  
const ICP_RULES = {
  min_employees: 50,        // Disqualify if BELOW this
  min_revenue: 5000000,     // $5M minimum - disqualify if BELOW this
  target_industries: [
    "technology", "software", "saas", "b2b", "fintech", "ai", 
    "machine learning", "data", "analytics", "cloud", "cybersecurity",
    "enterprise software", "api", "platform", "automation", "information technology"
  ]
};

for (const item of items) {
  const data = item.json;

  // Skip if Apollo enrichment failed
  if (data.apollo_enrichment_status !== 'success') {
    results.push({
      json: {
        ...data,
        icp_status: 'enrichment_failed',
        disqualification_reasons: [`Apollo enrichment failed: ${data.apollo_enrichment_error || 'Unknown error'}`],
        workflow_stage: 'enrichment_failed',
        next_workflow: null
      }
    });
    continue;
  }

  const disqualificationReasons = [];

  // 1. Employee Count Check - Disqualify if BELOW minimum
  const employees = data.apollo_employee_count;
  if (!employees || employees < ICP_RULES.min_employees) {
    disqualificationReasons.push(`Too small (${employees || 0} employees < ${ICP_RULES.min_employees} minimum)`);
  }
  // Note: No upper limit - bigger companies are MORE qualified

  // 2. Industry/Description Check
  const industry = (data.apollo_industry || '').toLowerCase();
  const description = (data.apollo_description || '').toLowerCase();
  const companyName = (data.apollo_company_name || '').toLowerCase();

  const industryMatch = ICP_RULES.target_industries.some(target => 
    industry.includes(target) || description.includes(target) || companyName.includes(target)
  );

  if (!industryMatch) {
    disqualificationReasons.push(`Industry not in target list (${data.apollo_industry || 'Unknown'})`);
  }

  // 3. Revenue Check - Only disqualify if BELOW minimum (or no data for large companies)
  const annualRevenue = data.apollo_annual_revenue;
  if (employees && employees >= 100) {
    // For larger companies, we expect revenue data
    if (!annualRevenue || annualRevenue === null) {
      disqualificationReasons.push('No revenue data for company of this size');
    } else if (annualRevenue < ICP_RULES.min_revenue) {
      disqualificationReasons.push(`Revenue too low ($${(annualRevenue/1000000).toFixed(1)}M < $${ICP_RULES.min_revenue/1000000}M minimum)`);
    }
    // Note: No upper revenue limit - higher revenue is better!
  }

  // If disqualified, mark and continue
  if (disqualificationReasons.length > 0) {
    results.push({
      json: {
        ...data,
        icp_status: 'disqualified',
        disqualification_reasons: disqualificationReasons,
        workflow_stage: 'icp_filtering',
        next_workflow: null
      }
    });
    continue;
  }

  // Calculate estimated ARR (rough estimate based on revenue)
  const estimatedARR = annualRevenue ? Math.round(annualRevenue * 0.15) : null;

  // Qualified! Prepare for next workflow stage
  results.push({
    json: {
      ...data,
      icp_status: 'qualified',
      estimated_arr: estimatedARR,
      icp_match: true,
      workflow_stage: 'icp_qualified',
      next_workflow: 'contact_discovery',
      qualified_at: new Date().toISOString()
    }
  });
}

const qualified = results.filter(r => r.json.icp_status === 'qualified').length;
const disqualified = results.filter(r => r.json.icp_status === 'disqualified').length;
const failed = results.filter(r => r.json.icp_status === 'enrichment_failed').length;

console.log(`ICP Filtering Results:`);
console.log(`✓ Qualified: ${qualified}`);
console.log(`✗ Disqualified: ${disqualified}`);
console.log(`⚠ Failed: ${failed}`);

return results;

// Extract actual company domain/name from job listing
const items = $input.all();
const results = [];

for (const item of items) {
  const data = item.json;

  // Extract company from Welcome to the Jungle URL
  let companyName = null;
  let companyDomain = null;

  if (data.url && data.url.includes('welcometothejungle.com')) {
    // Extract company slug from URL: /companies/swan/jobs/
    const urlMatch = data.url.match(/\/companies\/([^\/]+)\//);
    if (urlMatch) {
      companyName = urlMatch[1];

      // Common domain patterns
      const domainMap = {
        'swan': 'swan.io',
        'spendesk': 'spendesk.com',
        'enky': 'enky.com',
        'stripe': 'stripe.com',
        'notion': 'notion.so',
        'figma': 'figma.com',
        'vercel': 'vercel.com',
        'datadog': 'datadoghq.com'
      };

      companyDomain = domainMap[companyName] || `${companyName}.com`;
    }
  }

  // Extract company from The Ladder URLs
  else if (data.url && data.url.includes('theladders.com')) {
    // Pattern: /job/job-title-words-COMPANYNAME-location-state_id
    // We need to find the company name which is usually before the location
    const urlParts = data.url.split('/job/')[1];
    if (urlParts) {
      const jobSlug = urlParts.split('?')[0]; // Remove query params
      const parts = jobSlug.split('-');

      // Look for known company patterns or extract from end
      let companyPart = null;

      // Check for known long company names first
      const joinedParts = parts.join('-');
      if (joinedParts.includes('theblackstonegrouplp')) {
        companyPart = 'theblackstonegrouplp';
      } else if (joinedParts.includes('accenture')) {
        companyPart = 'accenture';
      } else if (joinedParts.includes('surescripts')) {
        companyPart = 'surescripts';
      } else if (joinedParts.includes('safetyculture')) {
        companyPart = 'safetyculture';
      } else if (joinedParts.includes('visa')) {
        companyPart = 'visa';
      } else if (joinedParts.includes('tend')) {
        companyPart = 'tend';
      } else if (joinedParts.includes('maze')) {
        companyPart = 'maze';
      }

      if (companyPart) {
        // Known company mappings
        const ladderCompanyMap = {
          'theblackstonegrouplp': 'blackstone.com',
          'accenture': 'accenture.com',
          'surescripts': 'surescripts.com',
          'safetyculture': 'safetyculture.com',
          'visa': 'visa.com',
          'tend': 'tend.io',
          'maze': 'maze.co'
        };

        companyName = companyPart;
        companyDomain = ladderCompanyMap[companyPart] || `${companyPart}.com`;
      }
    }
  }

  // Alternative: Extract company from job title for any source
  if (!companyName && data.title) {
    // Look for " at CompanyName" pattern
    const titleMatch = data.title.match(/ at (.+?)(?:\s|$)/);
    if (titleMatch) {
      companyName = titleMatch[1].trim();
      companyDomain = `${companyName.toLowerCase().replace(/\s+/g, '')}.com`;
    }
  }

  results.push({
    json: {
      ...data,
      target_company_name: companyName,
      target_company_domain: companyDomain,
      enrichment_type: companyDomain ? 'domain' : 'name'
    }
  });
}

return results;

// Enhanced Apollo Enrichment with Funding Data and ICP Rules - with batching
const items = $input.all();
const apolloKey = $('Set Environment Variables').first().json.APOLLO_API_KEY;
const results = [];
const processedDomains = new Map();
const enrichmentCache = new Map();
const BATCH_SIZE = 150;

console.log(`Starting Apollo enrichment with funding analysis for ${items.length} items`);

// Helper functions
function extractTotalFunding(apolloOrg) {
  const totalFunding = apolloOrg.total_funding;
  if (totalFunding && typeof totalFunding === 'number') {
    return totalFunding;
  }

  const fundingPrinted = apolloOrg.total_funding_printed;
  if (fundingPrinted && typeof fundingPrinted === 'string') {
    const match = fundingPrinted.match(/\$?([\d,]+(?:\.\d+)?)\s*([KkMmBb]?)/);
    if (match) {
      let value = parseFloat(match[1].replace(/,/g, ''));
      const unit = match[2]?.toLowerCase();
      if (unit === 'k') value *= 1000;
      else if (unit === 'm') value *= 1000000;
      else if (unit === 'b') value *= 1000000000;
      return value;
    }
  }

  return null;
}

function estimateArrFromFunding(fundingData) {
  const { total_funding, latest_funding_stage } = fundingData;

  if (fundingData.annual_revenue) {
    return fundingData.annual_revenue;
  }

  if (!total_funding || !latest_funding_stage) return null;

  const stage = latest_funding_stage.toLowerCase();

  if (stage.includes('seed')) return Math.min(total_funding * 0.3, 2000000);
  if (stage.includes('series a')) return Math.min(total_funding * 0.4, 10000000);
  if (stage.includes('series b')) return Math.min(total_funding * 0.3, 30000000);
  if (stage.includes('series c')) return Math.min(total_funding * 0.25, 80000000);
  if (stage.includes('series d') || stage.includes('late')) return Math.min(total_funding * 0.2, 200000000);

  return total_funding * 0.25;
}

function createSignalType(fundingData) {
  const { total_funding, latest_funding_stage } = fundingData;
  if (total_funding && latest_funding_stage) {
    const fundingMillion = (total_funding / 1000000).toFixed(1);
    return `$${fundingMillion}M ${latest_funding_stage}`;
  }
  return null;
}

const TITLE_PRIORITY = [
  "founder", "ceo", "chief executive",
  "vp of sales", "vice president sales", "vp sales",
  "head of sales", "sales director",
  "vp of marketing", "vice president marketing", "vp marketing", "head of marketing",
  "chief revenue officer", "cro",
  "chief technology officer", "cto",
  "president", "co-founder"
];

function scoreTitle(title) {
  if (!title) return 999;
  const titleLower = title.toLowerCase();
  for (let j = 0; j < TITLE_PRIORITY.length; j++) {
    if (titleLower.includes(TITLE_PRIORITY[j])) {
      return j;
    }
  }
  return 999;
}

// Batch loop
for (let batchStart = 0; batchStart < items.length; batchStart += BATCH_SIZE) {
  const batch = items.slice(batchStart, batchStart + BATCH_SIZE);

  console.log(`Processing batch ${batchStart / BATCH_SIZE + 1} (${batch.length} items)`);

  for (let i = 0; i < batch.length; i++) {
    const itemIndex = batchStart + i;
    const item = batch[i];
    const data = item.json;
    const targetDomain = data.target_company_domain;

    try {
      if (!targetDomain) {
        console.log(`Skipping item ${itemIndex + 1}: No target company domain`);
        results.push({
          json: {
            ...data,
            apollo_enrichment_status: 'skipped',
            apollo_enrichment_error: 'No target company domain found'
          }
        });
        continue;
      }

      if (enrichmentCache.has(targetDomain)) {
        console.log(`Using cached data for ${targetDomain} (item ${itemIndex + 1})`);
        const cachedEnrichment = enrichmentCache.get(targetDomain);
        results.push({
          json: {
            ...data,
            ...cachedEnrichment,
            id: data.id,
            source: data.source,
            url: data.url,
            title: data.title,
            date_scraped: data.date_scraped
          }
        });
        continue;
      }

      console.log(`Enriching ${targetDomain} (${itemIndex + 1}/${items.length}) - NEW DOMAIN`);

      const companyResponse = await this.helpers.request({
        method: 'POST',
        url: 'https://api.apollo.io/v1/organizations/enrich',
        headers: {
          'Content-Type': 'application/json',
          'Cache-Control': 'no-cache',
          'X-Api-Key': apolloKey
        },
        body: { domain: targetDomain },
        json: true,
        timeout: 30000
      });

      const org = companyResponse.organization || {};

      const totalFunding = extractTotalFunding(org);
      const fundingData = {
        total_funding: totalFunding,
        total_funding_printed: org.total_funding_printed,
        latest_funding_round_date: org.latest_funding_round_date,
        latest_funding_stage: org.latest_funding_stage,
        funding_events: org.funding_events,
        annual_revenue: org.annual_revenue,
        annual_revenue_printed: org.annual_revenue_printed
      };

      const estimatedArr = estimateArrFromFunding(fundingData);
      const signalType = createSignalType(fundingData);

      const companyData = {
        apollo_company_name: org.name || null,
        apollo_industry: org.industry || null,
        apollo_employee_count: org.estimated_num_employees || null,
        apollo_annual_revenue: org.annual_revenue || null,
        apollo_annual_revenue_printed: org.annual_revenue_printed || null,
        apollo_founded_year: org.founded_year || null,
        apollo_linkedin_url: org.linkedin_url || null,
        apollo_website_url: org.website_url || null,
        apollo_country: org.country || null,
        apollo_city: org.city || null,
        apollo_state: org.state || null,
        apollo_description: org.short_description || null,
        total_funding: totalFunding,
        total_funding_printed: org.total_funding_printed,
        latest_funding_round_date: org.latest_funding_round_date,
        latest_funding_stage: org.latest_funding_stage,
        funding_events: org.funding_events,
        estimated_arr: estimatedArr,
        arr_estimate: org.annual_revenue_printed || (estimatedArr ? `$${(estimatedArr / 1000000).toFixed(1)}M` : null),
        signal_type: signalType,
        ramp_time: "6 months"
      };

      await new Promise(resolve => setTimeout(resolve, 500));

      const peopleResponse = await this.helpers.request({
        method: 'POST',
        url: 'https://api.apollo.io/v1/mixed_people/search',
        headers: {
          'Content-Type': 'application/json',
          'Cache-Control': 'no-cache',
          'X-Api-Key': apolloKey
        },
        body: {
          domain: targetDomain,
          per_page: 25,
          page: 1,
          person_titles: [
            "CEO", "Chief Executive Officer", "Founder", "Co-Founder",
            "VP Sales", "Vice President Sales", "Head of Sales", "Sales Director",
            "VP Marketing", "Vice President Marketing", "Head of Marketing",
            "Chief Revenue Officer", "CRO", "President", "Chief Technology Officer", "CTO"
          ]
        },
        json: true,
        timeout: 30000
      });

      const people = peopleResponse.people || [];

      let bestContact = null;
      let bestScore = 999;

      for (const person of people) {
        const score = scoreTitle(person.title || '');
        if (score < bestScore) {
          bestScore = score;
          bestContact = {
            apollo_id: person.id,
            name: person.name,
            first_name: person.first_name,
            last_name: person.last_name,
            email: person.email,
            title: person.title,
            linkedin_url: person.linkedin_url,
            phone: person.phone_numbers?.[0]?.raw_number,
            source: 'apollo_people'
          };
        }
      }

      if (!bestContact) {
        bestContact = {
          apollo_id: null,
          name: null,
          first_name: null,
          last_name: null,
          email: null,
          title: 'CEO',
          linkedin_url: companyData.apollo_linkedin_url,
          phone: null,
          source: 'needs_enrichment'
        };
      }

      const enrichmentData = {
        ...companyData,
        contact: bestContact,
        contact_score: bestScore,
        people_found: people.length,
        apollo_enrichment_status: 'success',
        apollo_enriched_at: new Date().toISOString(),
        workflow_stage: 'apollo_enriched_with_funding'
      };

      enrichmentCache.set(targetDomain, enrichmentData);
      results.push({ json: { ...data, ...enrichmentData } });

      console.log(`✓ Successfully enriched ${targetDomain}: ${org.name || 'Unknown'} with ${people.length} people`);
      console.log(`  Funding: ${signalType || 'No funding data'}`);
      console.log(`  Est. ARR: ${estimatedArr ? '$' + (estimatedArr / 1000000).toFixed(1) + 'M' : 'Unknown'}`);

      if (itemIndex < items.length - 1) {
        await new Promise(resolve => setTimeout(resolve, 1000));
      }

    } catch (error) {
      console.log(`✗ Error enriching ${targetDomain}: ${error.message}`);
      results.push({
        json: {
          ...data,
          apollo_enrichment_status: 'error',
          apollo_enrichment_error: error.message,
          apollo_enriched_at: new Date().toISOString()
        }
      });
    }
  }

  // Optional: wait between batches
  await new Promise(resolve => setTimeout(resolve, 5000));
}

// Final logs
const uniqueDomains = enrichmentCache.size;
const successCount = results.filter(r => r.json.apollo_enrichment_status === 'success').length;
const withFunding = results.filter(r => r.json.total_funding).length;
const withArrEstimate = results.filter(r => r.json.estimated_arr).length;

console.log(`Completed Apollo enrichment for ${results.length} items`);
console.log(`Unique domains processed: ${uniqueDomains}`);
console.log(`Success: ${successCount}`);
console.log(`With funding data: ${withFunding}`);
console.log(`With ARR estimates: ${withArrEstimate}`);
console.log(`Errors: ${results.filter(r => r.json.apollo_enrichment_status === 'error').length}`);
console.log(`Skipped: ${results.filter(r => r.json.apollo_enrichment_status === 'skipped').length}`);

return results;

// Process ZeroBounce verification
const contactData = $('Email Discovery Success?').item.json;
const verificationData = $input.first().json;

let emailStatus = 'unknown';
let safeToSend = false;
let verificationScore = 0;

// Process ZeroBounce response
if (verificationData && verificationData.status) {
  emailStatus = verificationData.status;
  verificationScore = verificationData.score || 0;

  // Consider safe if valid or catch-all with high score
  safeToSend = ['valid'].includes(emailStatus) || 
               (emailStatus === 'catch-all' && verificationScore >= 7);
} else if (contactData.contact.email_confidence >= 90) {
  // If ZeroBounce fails but Hunter confidence is very high, allow it
  safeToSend = true;
  emailStatus = 'hunter_high_confidence';
}

// Reject if email is not safe to send
if (!safeToSend) {
  return [{
    json: {
      ...contactData,
      email_verification: {
        status: emailStatus,
        safe_to_send: false,
        score: verificationScore,
        verification_data: verificationData
      },
      skip_reason: `email_verification_failed_${emailStatus}`,
      workflow_stage: 'email_verification_failed',
      next_workflow: null
    }
  }];
}

// Email verified successfully - prepare for content generation
return [{
  json: {
    ...contactData,
    email_verification: {
      status: emailStatus,
      safe_to_send: true,
      score: verificationScore,
      verification_data: verificationData
    },
    workflow_stage: 'email_verified',
    next_workflow: 'content_generation',

    // Prepare signal type for content generation
    signal_type: contactData.funding_stage ? 
      `${contactData.funding_stage} funding ${contactData.total_funding ? ' ($' + (contactData.total_funding/1000000).toFixed(1) + 'M)' : '(undisclosed)'}` :
      `hiring ${contactData.contact.title}`
  }
}];

// Hunter Email Finder + Domain Search Fallback
const items = $input.all();
const hunterApiKey = $('Set Environment Variables').first().json.HUNTER_API_KEY;
const results = [];

console.log(`=== HUNTER EMAIL DISCOVERY WITH FALLBACK ===`);
console.log(`Processing ${items.length} items`);

for (let i = 0; i < items.length; i++) {
  const data = items[i].json;

  console.log(`\n--- Item ${i + 1}/${items.length} ---`);
  console.log('ID:', data.id);
  console.log('Company:', data.apollo_company_name || data.target_company_name);
  console.log('Domain:', data.target_company_domain);
  console.log('Apollo Contact:', data.contact?.name || 'No contact data');

  try {
    // Validation checks
    if (!data.target_company_domain || !hunterApiKey || !data.contact) {
      console.log('⚠ Skipping: Missing required data');
      results.push({
        json: {
          ...data,
          hunter_email_finder_status: 'skipped',
          hunter_email_finder_error: 'Missing domain, API key, or contact data'
        }
      });
      continue;
    }

    // Check if Apollo email is usable
    const apolloEmailLocked = !data.contact.email || 
                             data.contact.email.includes('email_not_unlocked') || 
                             data.contact.email.includes('@domain.com');

    if (!apolloEmailLocked) {
      console.log('✓ Apollo email is usable, skipping Hunter');
      results.push({
        json: {
          ...data,
          hunter_email_finder_status: 'skipped_apollo_email_available',
          email_discovery_source: 'apollo',
          workflow_stage: 'email_verified_ready'
        }
      });
      continue;
    }

    const firstName = data.contact.first_name || '';
    const lastName = data.contact.last_name || '';
    const MIN_CONFIDENCE = 75;
    let emailFound = false;
    let updatedContact = { ...data.contact };
    let hunterResponse = {};

    // STEP 1: Try Hunter Email Finder (specific person search)
    if (firstName && lastName) {
      console.log('Step 1: Hunter Email Finder for specific person...');

      let queryString = `domain=${encodeURIComponent(data.target_company_domain)}&api_key=${encodeURIComponent(hunterApiKey)}`;
      queryString += `&first_name=${encodeURIComponent(firstName)}&last_name=${encodeURIComponent(lastName)}`;

      const emailFinderUrl = `https://api.hunter.io/v2/email-finder?${queryString}`;

      const emailFinderResponse = await this.helpers.request({
        method: 'GET',
        url: emailFinderUrl,
        headers: { 'Content-Type': 'application/json' },
        json: true,
        timeout: 30000
      });

      console.log('Email Finder result:', {
        emailFound: !!emailFinderResponse.data?.email,
        confidence: emailFinderResponse.data?.confidence || 0
      });

      if (emailFinderResponse.data?.email && emailFinderResponse.data.confidence >= MIN_CONFIDENCE) {
        updatedContact.email = emailFinderResponse.data.email;
        updatedContact.email_confidence = emailFinderResponse.data.confidence;
        updatedContact.email_source = 'hunter_email_finder';
        emailFound = true;
        hunterResponse = emailFinderResponse;

        console.log(`✓ Email Finder success: ${emailFinderResponse.data.email} (${emailFinderResponse.data.confidence}%)`);
      } else {
        console.log('✗ Email Finder: No high-confidence email found');
      }

      // Rate limiting between API calls
      await new Promise(resolve => setTimeout(resolve, 1000));
    } else {
      console.log('⚠ Skipping Email Finder: Missing first/last name');
    }

    // STEP 2: If Email Finder failed, try Domain Search
    if (!emailFound) {
      console.log('Step 2: Hunter Domain Search fallback...');

      const domainSearchUrl = `https://api.hunter.io/v2/domain-search?domain=${encodeURIComponent(data.target_company_domain)}&limit=25&api_key=${encodeURIComponent(hunterApiKey)}`;

      const domainSearchResponse = await this.helpers.request({
        method: 'GET',
        url: domainSearchUrl,
        headers: { 'Content-Type': 'application/json' },
        json: true,
        timeout: 30000
      });

      const emails = domainSearchResponse.data?.emails || [];
      console.log(`Domain Search found ${emails.length} emails`);

      if (emails.length > 0) {
        let bestMatch = null;
        let bestScore = 0;

        // Find best matching email
        for (const emailData of emails) {
          if (emailData.confidence < MIN_CONFIDENCE) continue;

          let score = emailData.confidence; // Base score from confidence
          const emailPosition = (emailData.position || '').toLowerCase();
          const contactTitle = (data.contact.title || '').toLowerCase();

          // Exact name match (highest priority)
          if (firstName && lastName) {
