// Helper function to find field value using multiple possible paths
function findFieldValue(obj, possiblePaths) {
    for (const path of possiblePaths) {
        const value = getNestedValue(obj, path);
        if (value && value !== 'email_not_unlocked@domain.com' && value !== '') {
            return value;
        }
    }
    return null;
}

// Helper function to get nested object value by path
function getNestedValue(obj, path) {
    return path.split('.').reduce((current, key) => {
        return current && current[key] !== undefined ? current[key] : null;
    }, obj);
}

// Helper function to clean and validate data for Supabase
function cleanValue(value, maxLength = null) {
    if (value === null || value === undefined) return null;
    if (typeof value !== 'string') value = String(value);
    value = value.trim();
    if (value === '' || value === 'null' || value === 'undefined') return null;
    if (maxLength && value.length > maxLength) {
        return value.substring(0, maxLength - 3) + '...';
    }
    return value;
}

// ICP Validation Functions - SOFTENED CRITERIA (Only Lower Bounds)
function isValidEmployeeCount(count) {
    if (!count) return true; // Default to true if no data (benefit of doubt)
    const num = parseInt(count);
    return num >= 50; // Only minimum requirement, no upper limit
}

function isValidARR(revenue, revenuePrinted) {
    if (!revenue && !revenuePrinted) return true; // Default to true if no data

    // Parse revenue from printed string (e.g., "47M", "5.2B", "150.6M")
    let arrValue = 0;
    if (revenuePrinted) {
        const cleanRevenue = revenuePrinted.replace(/[,$]/g, '');
        if (cleanRevenue.includes('B')) {
            arrValue = parseFloat(cleanRevenue) * 1000; // Convert billions to millions
        } else if (cleanRevenue.includes('M')) {
            arrValue = parseFloat(cleanRevenue);
        } else if (cleanRevenue.includes('K')) {
            arrValue = parseFloat(cleanRevenue) / 1000; // Convert thousands to millions
        }
    } else if (revenue) {
        arrValue = revenue / 1000000; // Convert to millions
    }

    return arrValue >= 10; // Only minimum requirement, no upper limit
}

function isB2BTech(industry, description, companyName) {
    if (!industry && !description && !companyName) return true; // Default to true if no info

    const b2bTechKeywords = [
        'software', 'technology', 'saas', 'information technology', 'tech', 'IT',
        'cloud', 'data', 'analytics', 'platform', 'api', 'infrastructure',
