// Simple duplicate check using n8n's built-in request function
const inputItems = $input.all();
const supabaseKey = $('Set Environment Variables').first().json.SUPABASE_KEY;
const supabaseUrl = 'https://vdwumxzyknmkxokohyge.supabase.co';


const itemsToProcess = inputItems; // No slicing, process everything
const results = [];

console.log(`Processing ${itemsToProcess.length} items out of ${inputItems.length} total`);

for (const item of itemsToProcess) {
  const itemData = item.json;

  try {
    // Create the query URL manually
    const cutoffDate = new Date();
    cutoffDate.setDate(cutoffDate.getDate() - 90);

    const queryParams = [
      `select=id,hash,created_at`,
      `hash=eq.${itemData.dedupe_hash}`,
      `created_at=gte.${cutoffDate.toISOString()}`,
      `limit=1`
    ].join('&');

    const url = `${supabaseUrl}/rest/v1/dedupe_hashes?${queryParams}`;

    // Use n8n's built-in request method
    const response = await this.helpers.request({
      method: 'GET',
      url: url,
      headers: {
        'Authorization': `Bearer ${supabaseKey}`,
        'apikey': supabaseKey,
        'Content-Type': 'application/json'
      },
      timeout: 10000,
      json: true
    });

    // Check if hash exists
    const isDuplicate = response && response.length > 0;

    results.push({
      json: {
        ...itemData,
        is_duplicate: isDuplicate,
        duplicate_check_status: 'success',
        checked_at: new Date().toISOString()
      }
    });

    console.log(`Checked ${itemData.domain}: ${isDuplicate ? 'duplicate' : 'new'}`);

  } catch (error) {
    console.log(`Error checking hash for ${itemData.domain}: ${error.message}`);

    results.push({
      json: {
        ...itemData,
        is_duplicate: false, // Assume not duplicate on error
        duplicate_check_status: 'error',
        duplicate_check_error: error.message,
        checked_at: new Date().toISOString()
      }
    });
  }
}

console.log(`Completed processing ${results.length} items`);
return results;

